If you look at the flow here, every verifyX() method has this branch "ec == boost::system::errc::invalid_argument"  Which duplicates a lot of code.

What if we did something like


if (ec ==  boost::system::errc::invalid_argument){
   std::string_view name = getErrorMessage();
   if (name == "Name"){
       messages::propertyValueIncorrect(res, *name, name);
   } else if (name == "ReportingType"){
       messages::propertyValueIncorrect(res, *reportingType, name);
   }
}

In a single method.  That would reduce the code quite a bit.

Each of these verify<x> functions is identical (with an exception or two for mismatched param names.)

Can we just pass in the name of the argument, and have;

VerifyParameter(res, ec, errorMessage, paramName, value;

and deduplicate most of these?
